    const highLimit = "<span class=\"game-label high-limit\"><img src=\"assets/images/labels/high-limit.png\" alt=\"High limit label\"></span>";

    return (
        <div className={`box ${game.size}`} data-game={game.name} data-tags={game.tags}>
            <a href={game.url}>
                <img className="game-img" src={require(`${game.image}`)} alt={game.name} />
                {labels}
            </a>
        </div>
    )
}
